INSERT INTO `feedback_info` VALUES (8,'提交题目的代码，空间我感觉不需要击败百分之80以上，为什么？因为leetcdoe同一个代码，你多测几次，给你显示你的复杂度会在一个区间内浮动，然后，运气好点击败80%+ 运气差点就击败10%，感觉只要空间复杂度一样，不太需要空间复杂度击败多少多少','2022-10-30 00:00:00',2,'确实，leetcode的时间和空间击败比例计算不是很稳定，算法更看重的是时间复杂度，空间复杂度只要和最优解保持一致就可以。目前代码库README已更新，不再要求空间复杂度击败占比超过80%'),(9,'如果更换默认题单，则刷题数量是否计算有误\n间隔多日，再次刷已经ac过的题目，刷题数量是否显示不变','2022-11-07 00:00:00',2,'确实会计算有误，后台根据账号去拉刷题数据，这个数据和当前官方主页上的数据保持一致，目前无法解决同账号更换题单的问题...；刷已经ac的题目是不会增加刷题数量的，刷未ac的可以'),(16,'需要补卡功能','2022-11-14 00:00:00',3,'连续打卡的规则是：只要一天未刷就从0开始统计，目的是让用户看中这个指标。用道具来弥补不是我们的意图，如果看重就请坚持吧！！'),(17,'增加周赛竞猜功能，竞猜自己这次名次上分情况，赌对了 签到+3天，错了 签到-3天','2022-11-16 00:00:00',3,'在连续打卡天数这个指标上去做加减法其实意义不大，这个指标我认为是反应一个人的坚持，这个指标一定要实事求是；竞猜周赛分数其实可以通过设定目标来实现'),(18,'每天随机抽取以为幸运玩家，完成指定题目 分享一题多解。。succ +3签到 fail -3 签到','2022-11-16 00:00:00',2,'随机抽题目前已经实现了，每天6点会从已经提供了email的用户中随机抽取两名用户完成指定的同一道leetcode题目，完成后获得相应积分'),(19,'增加 签到天数 称号，签到10天 小白兔， 签到30天  勤勉的乌龟  签到 100天  大魔王 签到365天 自定义称号','2022-11-16 00:00:00',1,'后面会新增一个累计打卡天数的功能，然后赋予相应称号'),(20,'增加同城 约刷功能，结识更多的伙伴，知己，红颜。向比自己厉害的人学习，线下基情交流。能和你一起周末刷题是我能够想到最浪漫的事。','2022-11-17 00:00:00',3,'同城约刷需要采集用户的城市信息，线下约会存在风险，群主付不起任何责任，这个真不能实施，可以自己私下约'),(21,'增加求签功能，今天刷题运势，宜刷什么类型题目，不宜刷什么题目，用什么姿势刷题，倒立刷题还是怎么刷。','2022-11-17 00:00:00',3,'好好刷题，不搞神学哈～'),(22,'增加我想了解……功能，有时候想学习某一类问题，可能无从下手，我们需要能有专题。','2022-11-17 00:00:00',1,'这是一个很好的建议，其实我们的git代码库就是为这个服务的，只是这个需要的周期会比较长，需要大家的共同努力，群主会抽时间将算法进行归类，最终服务于群友'),(23,'打卡一年，希望能够获得群主签名黑丝照一张，包邮。','2022-11-18 00:00:00',3,'什么鬼，口味这么重！！看抖音小姐姐不好吗？？'),(24,'提供可自选的关键字排序。如，按竞赛分数排序。','2022-11-18 00:00:00',2,'这个前端已经支持了，点击表格字段名称即可实现排序'),(25,'设定目标的时候希望可以根据题目难度来设定\n比如我想再做20个hard 20个medium这样子 不知道是否好实现\n麻烦群主大大了','2022-11-29 00:00:00',1,'可以实现，这个需求是不是太细化了，设定一个总刷题量的目标是不是也可以？难道会逃避困难题哈哈'),(26,'希望也可以按用户名称排序吧~~','2022-12-04 00:00:00',1,'目前已经支持了'),(27,'增加结对编程，老带新，一定期限内帮助新人达到一定的周赛积分，可获得一定的积分奖励','2022-12-08 00:00:00',1,'目前网站的功能都是基于单人，还未考虑协作式的功能，协作式需要多人参与操作难度大，建议有问题直接抛到群里，佬们还是很乐意回答的'),(28,'增加拜师，师门系统，解决师门帮派周赛PK机制。','2022-12-08 00:00:00',1,'多人参与的功能开发操作难度大，效果也不会太好，如果想拜师直接私聊加个好友吧。周赛pk机制到是比较好玩，由于每个人水平差异较大，这个只能按分数段（分数段区间还不能太大）来组织pk，并且需要抓去排名数据，这个功能后面考虑实现'),(29,'希望扩大称号的评定范围：\n- 不要只局限于懒惰者赋予「懒惰称号」催促\n- 勤奋者也应该赋予「勤奋称号」鼓励','2022-12-12 00:00:00',1,'没问题，这个有考虑，后面加一个累积打卡天数，设置相应的称号级别'),(30,'自己设定的目标，希望能放这醒目的位置：要么通过过滤，要么放在一个独立的区块里，这样方便每天查看进度！！','2022-12-12 00:00:00',1,'ok, 添加一个搜索功能吧'),(31,'意见反馈板块里面，可以显示用户名称吗，不要都是「访客+数字」的形式吧？','2022-12-12 00:00:00',1,'目前网站是弱账号系统，无法判断提意见的用户是哪位，如果做成强账号系统就需要用户登陆了，这样的话整个账号系统就要重新设计了，用户进来看个信息还需要登陆其实不太友好'),(32,'打卡只统计新题我觉得不合理，复习老题应该也算入打卡统计里，精刷>追求刷题量','2022-12-14 00:00:00',1,'这个其实有想过，目的还是要求用户刷新题，在题量不超过1000题的情况下还是多刷新题见见世面更重要'),(33,'按刷题数量来排名，显然是有些不合理的。\n建议按分值来统计，不同题目对应分值不同，比如简单题1分、中等题2分、困难题3分这样子，当然如果能再按照通过率之类的再细分、就更好了。','2022-12-14 00:00:00',1,'排名的方式很多，每个人的看法都不一样，您说的是其中一种方式，确实也挺合理。目前的积分其实并没有和刷题量，竞赛分数等挂钩，群主的想法其实是让大家站在一个起跑线上通过打卡，完成目标的方式去挣积分，积分排名只和付出挂勾，拉长时间来看，这些付出会反应到进步上，刷了足够多积分实力肯定不会差'),(34,'第一次注册加入排名的，之前的累积刷题数不应当计入日刷题数','2022-12-15 00:00:00',1,'因为首次加入系统只能拉到之前的存量数据并不知道当天用户是否刷过题，目前默认用户当天刷过题，但是当天加入的用户不会参与积分计算'),(35,'访客32的兄弟，其实连后台都不知道是谁反馈的意见，这个很难实现，31自然也就不好实现了','2022-12-16 00:00:00',1,''),(36,'目标类型为挑战PK、竞赛分数时，若提前达成，可以提前结算吗？','2022-12-16 00:00:00',1,'目标为竞赛分数则可以提前完成，目标为挑战pk则只有等到结束日期才会比较结果'),(37,'TAB“设定目标”中，用户可以对“目标类型”进行筛选','2022-12-29 00:00:00',1,''),(38,'「设定目标」板块中，「竞赛分数」和「总刷题量」这两个目标，希望能显示达成目标所需的 每日/周 额度！！','2022-12-31 00:00:00',1,''),(39,'成绩排名可以再增加一个指标：「社区贡献」，鼓励大家多输出（尤其是写一篇漂亮的题解，真的会收获很多）。','2023-01-03 00:00:00',1,''),(40,'希望加个题单（练气题单，筑基题单、金丹、元婴、渡劫）推荐功能，可以给刚入坑的小白一个完整的修炼手册，当然更高境界就需要自己探索了。\n题单可官方推荐，也可用户自定义，用户自定义的可分享。题单每个题有直达链接。','2023-02-15 00:00:00',1,''),(41,'1.自我介绍\n2.场景题，本来是需要控制台输入输出，面试官说可以用restful接口实现，数据可以不存在数据库\n3.你创建单例Baen保存数据有哪些问题\n4.并发条件下调用ArrayList的put()方法有没有线程安全问题，如何解决\n5.你这里用的Resource注入，还有没有别的依赖注入方式，他们的区别\n6.说到了Spring循环依赖，说一下\n7.你说到了synchroized，说一下原理是什么\n8.synchronized和lock的区别\n9.线程池中执行任务的线程之间如何通信，提交了A,B,C三个任务到线程池，现在A执行一半后，需要得到B执行一个阶段后的数据才能继续执行，同时B也需要A执行完后的数据才能继续执行，如何实现，说说思路\n10.你在项目中怎么做的索引优化和sql优化\n11.数据库事务特性和隔离级别\n12.说说MVCC机制的原理\n13.回表和索引下推了解吗\n14.项目中用redis做了什么功能，除了用到的这几个，redis常用数据结构还有哪些？\n15.一个被高并发访问的key突然失效属于什么问题，有哪些解决方案\n16.你在项目中redis和mysql是如何保持数据一致性的，是否能完全保证并发数据安全\n17.项目中用到了哪些mybatis标签\n18.#{}和${}的区别是什么\n19.mybatis的接口和xml文件如何一一对应，mapper中的接口能否重载','2023-02-16 00:00:00',1,''),(42,'华为机试\n1、给一个数组，范围[0,255]，让所有数字加上K（可正可负），得到一个新数组，找到新数组平均数最接近128的K，如果有多个同样接近的答案，取最小的K。\n新数组的每个数如果小于0，则变成0，大于255，则变成255。然后才能计算平均数。N大概几百个？\n解法：暴力枚举K\n2、给一个数组nums,每个数取值[1,10]，找到一个索引，左边乘积等于右边乘积，如果有多个索引，取最左边的，找不到输出-1\n数组长度1000个。\n解法：前缀和计算前面N个数乘积包含多少个2、3、5、7质数。暴力枚举每个索引，找到符合条件的即可\n3、输入一个需要凑的数M，再给一个长度为N的连续正整数数组an，an里的每个数可以取无限次。\n需要从an里找数，求和凑出M来。至多可以再引入一个小于an里最小值的正整数来凑。求所有方案数（答案保证总方案数为int型）\n例子：an= 2 3\nM=5\n方案数：2  \n解释：2 2 1   以及  3 2  （这里可以看到方案数跟取数的顺序无关）\n解法：int[] dp = new int[M+1]; // dp[X] 表示凑出X的方案数\ndp[0] = 1;\nfor i = min -> max\n for j = 1-> M\nif (j >=i) dp[j] += dp[j - i];\n算出后，再穷举add=1 -> min-1 \nans = dp[M] + dp[M - add]; \n','2023-02-24 00:00:00',1,''),(46,'感谢 @ericyu 报的bug，账号绑定后显示成功，但账户未再主页显示','2023-02-28 00:00:00',1,''),(47,'华为od社招一面题\n//题目描述：\n//给定两个以升序排列的整形数组 nums1 和 nums2, 以及一个整数 k。\n//定义一对值 (u,v)，其中第一个元素来自 nums1，第二个元素来自 nums2。\n//找到和最小的 k 对数字 (u1,v1), (u2,v2) ... (uk,vk)。\n//示例 1:\n//输入: nums1 = [1,7,11], nums2 = [2,4,6], k = 3\n//输出: [1,2],[1,4],[1,6]\n//解释: 返回序列中的前 3 对数：\n//     [1,2],[1,4],[1,6],[7,2],[7,4],[11,2],[7,6],[11,4],[11,6]\n//示例 2:\n//输入: nums1 = [1,1,2], nums2 = [1,2,3], k = 2\n//输出: [1,1],[1,1]\n//解释: 返回序列中的前 2 对数：\n//     [1,1],[1,1],[1,2],[2,1],[1,2],[2,2],[1,3],[1,3],[2,3]\n//示例 3:\n//输入: nums1 = [1,2], nums2 = [3], k = 3\n//输出: [1,3],[2,3]\n//解释: 也可能序列中所有的数对都被返回:[1,3],[2,3]','2023-03-03 00:00:00',1,''),(48,'华为od社招二面算法题 \n//已知一个整形数组nums，元素值均不重复，查找其中值第k大的元素（k从1开始）\n// 如果改成单链表找第K大呢？（不能修改链表任何结构）','2023-03-04 00:00:00',1,''),(49,'白龙马云行科技有限公司 1面 // java 了解队列的几种实现？ hashmap源码讲一下？ concurrentHashMap实现？ 了解java的锁吗？ 讲一讲synchronized实现？ spring怎么解决循环引用？ spring事务是干嘛用的？ 讲一讲mysql索引？ 什么时候失效？','2023-03-06 00:00:00',1,''),(50,'白龙马云行科技有限公司 1面补充，接下面的楼：\n讲一讲JVM垃圾染色机制\n','2023-03-06 00:00:00',1,''),(51,'测试','2023-03-10 00:00:00',1,''),(80,'接口不做限制？！？！，你这样的话这个意见反馈接口很容易被打，别人利用工具请求这个接口几千万次，你的数据库就会爆了，导致整个服务崩掉。而且，提交数据使用GET请求也不太合理，爬虫爬一下你的网站就会新增一条数据？！，建议弄个登录功能，使用GITHUB账号登录。','2023-03-10 00:00:00',1,''),(81,'并且，用户提交意见之后，应该重新渲染数据，让用户自己点击刷新才能看自己发的意见，确实有点不好体验了','2023-03-10 00:00:00',1,'');
